	j main_menu_loop

main_init_game:
    	li $a0, 0          # Posio inicial (altura = 0)
    	li $a1, 0          # Posio inicial (largura = 0)
    	li $a2, S_H        # Altura total da tela
    	li $a3, S_W        # Largura total da tela
	jal erase

	# draw game init field
	la $a0, game_img
	li $a1, 0
	li $a2, 0
	jal draw_image
	
	# Desenhar o paddle_img no centro inferior de game_img
	la $a0, paddle_img
	li $a1, P_INIT_Y    # Posio Y (parte inferior da tela)
	li $a2, P_INIT_X    # Posio X (centro da tela)
	jal draw_image
	
	#draw ball
	li $t0, 30
	sw $t0, ball_x
	sw $t0, ball_y
	
	la $a0, ball_img
	li $a1, 30
	li $a2, 30
	jal draw_image
	
	li $t0, BALL_FALLING
	sw $t0, ball_state

main_game_loop:    	
	lw $s1, 0($s0)       # Ler o estado do teclado
	lw $s2, 4($s0)       # Ler a tecla pressionada

    	#erase last ball position
    	lw $a0, ball_y
    	lw $a1, ball_x
    	li $a2, 4
    	li $a3, 5
    	jal erase
    	
    	# make ball do thing
    	lw $t0, ball_state
    	
    	# has enough frames passed since last ball movement?
    	lw $t1, frames_since_ball
    	beq $t1, 30, handle_ball
    	j end_handle_ball
    	
    	lw $t2, main_cnt
    	beq $t2, 140, ganhou
    	
handle_ball:
	li $t1, 0
	sw $t1, frames_since_ball
    	# is the ball falling?
    	beq $t0, BALL_FALLING, fall_ball
    	j end_fall_ball

fall_ball:
	# make ball fall by 1
    	# Update ball position
    	lw $t0, ball_x
    	lw $t1, ball_y
    	lw $t2, ball_vx
    	lw $t3, ball_vy
    	add $t0, $t0, $t2
    	add $t1, $t1, $t3
    	sw $t0, ball_x
    	sw $t1, ball_y

    	# Coliso com a parede superior
    	ble $t1, $zero, ball_wall_collision
    	# Coliso com a parede inferior
    	bge $t1, S_H, perdeu
    	# Coliso com a parede esquerda
    	blt $t0, 10, ball_wall_collision_left
    	# Coliso com a parede direito
    	bge $t0, 113, ball_wall_collision_right
    	
    	# Coliso com os blocos
	jal check_block_collision
    	
    	# Coliso com o paddle
    	j ball_paddle_collision
    	
end_fall_ball:
end_handle_ball:	
	lw $t1, frames_since_ball
	addi $t1, $t1, 1
	sw, $t1, frames_since_ball
	#draw ball new position
    	la $a0, ball_img
    	lw $a1, ball_y
    	lw $a2, ball_x
    	jal draw_image
	# Verify the key press
    	beq $s2, 97, move_paddle_left
    	beq $s2, 100, move_paddle_right
    
	j main_game_loop_NXT  # Pular para o prximo loop se nenhuma tecla foi pressionada

ball_wall_collision:

    # Inverta a direo da bola
    lw $t0, ball_vy
    not $t0, $t0
    sw $t0, ball_vy
    j end_handle_ball
    
ball_wall_collision_right:
    # Coliso com a parede superior
    bge $t1, S_H, ball_wall_collision
    
    lw $t0, ball_vx
    not $t0, $t0
    sw $t0, ball_vx
        
    j end_handle_ball
    
 ball_wall_collision_left:
    # Coliso com a parede superior
    beqz $t1, ball_wall_collision
    
    lw $t0, ball_vx
    not $t0, $t0
    sw $t0, ball_vx
        
    j end_handle_ball
    
ball_paddle_collision:
    lw $t0, ball_x
    lw $t1, ball_y
    lw $t2, paddle_x
    
    # Check if the ball's y coordinate is equal to the paddle's y coordinate
    li $t3, P_INIT_Y
    subi $t3, $t3, P_H
    beq $t1, $t3, check_paddle_x
    
    j end_ball_paddle_collision
    
check_paddle_x:
    # Check if the ball's x coordinate is within the paddle's width
    sub $t4, $t2, P_W
    blt $t0, $t4, end_ball_paddle_collision
    add $t4, $t2, P_W
    bgt $t0, $t4, end_ball_paddle_collision

    # If the ball has collided with the paddle, invert the ball's y velocity
    lw $t0, ball_vy
    not $t0, $t0
    sw $t0, ball_vy
      
end_ball_paddle_collision:
    j end_handle_ball
    
input_listener:
    # Verify the key press
    beq $s2, 97, move_paddle_left
    beq $s2, 100, move_paddle_right
    
input_listener_NXT:
    la $t2, debounce_timer
    lw $t0, 0($t2)
    addi $t0, $t0, 1
    sw $t0, 0($t2)
    j main_game_loop_NXT
		
move_paddle_left:
    lw $t0, frames_since_paddle
    beq $t0, 20, paddle_handle_left
    j paddle_handle_left_end

paddle_handle_left:
    li $t0, 0
    sw $t0, frames_since_paddle
    
    # Update paddle's x position
    la $t2, paddle_x
    lw $t0, 0($t2) 
    beq $t0, 10, main_game_loop_NXT
    
    li $a0, P_INIT_Y
    move $a1, $t0
    li $a2, P_H
    li $a3, P_W
    jal erase

    la $t2, paddle_x
    lw $t0, 0($t2)
    move $a0, $t0

    li $t1, -P_SPEED  # negative speed to move left
    add $t0, $t0, $t1
    sw $t0, 0($t2)
    la $a0, paddle_img
    li $a1, P_INIT_Y
    move $a2, $t0
    
    jal draw_image
    
paddle_handle_left_end:
    lw $t0, frames_since_paddle
    addi $t0, $t0, 1
    sw $t0, frames_since_paddle
    # Add a delay
    #li $v0, 32
    #li $a0, DLY  # adjust this value to change the delay
    #syscall
    j main_game_loop_NXT

move_paddle_right:
    lw $t0, frames_since_paddle
    beq $t0, 20, paddle_handle_right
    j paddle_handle_right_end

paddle_handle_right:
    li $t0, 0
    sw $t0, frames_since_paddle
    
    # Update paddle's x position
    la $t2, paddle_x
    lw $t0, 0($t2) 
    
    beq $t0, 98, main_game_loop_NXT

    li $a0, P_INIT_Y
    move $a1, $t0
    li $a2, P_H
    li $a3, P_W
    jal erase

    la $t2, paddle_x
    lw $t0, 0($t2)
    move $a0, $t0

    li $t1, P_SPEED  # positive speed to move right
    add $t0, $t0, $t1
    sw $t0, 0($t2)
    la $a0, paddle_img
    li $a1, P_INIT_Y
    move $a2, $t0
    jal draw_image
   
paddle_handle_right_end:
    lw $t0, frames_since_paddle
    addi $t0, $t0, 1
    sw $t0, frames_since_paddle
    # Add a delay
    #li $v0, 32
    #li $a0, DLY  # adjust this value to change the delay
    #syscall
    j main_game_loop_NXT
             
ganhou:
    	li $a0, 0          # Posio inicial (altura = 0)
    	li $a1, 0          # Posio inicial (largura = 0)
    	li $a2, S_H        # Altura total da tela
    	li $a3, S_W        # Largura total da tela
	jal erase

	# draw start menu
	la $a0, ganhou_img
	li $a1, 0
	li $a2, 0
	jal draw_image
	j main_EXIT

perdeu:
    	li $a0, 0          # Posio inicial (altura = 0)
    	li $a1, 0          # Posio inicial (largura = 0)
    	li $a2, S_H        # Altura total da tela
    	li $a3, S_W        # Largura total da tela
	jal erase

	# draw start menu
	la $a0, game_over_img
	li $a1, 0
	li $a2, 0
	jal draw_image
	
perdeu_loop:
	li $s0, 0xffff0000
	lw $s1, 0($s0)
	bne $s1, 1, perdeu_loop_NXT
	lw $s1, 4($s0)
	beq $s1, 115, perdeu_loop_keyboard_press_s
	j perdeu_loop_NXT
	
perdeu_loop_keyboard_press_s:
	# reset game info
	li $t0, P_INIT_X
	sw $t0, paddle_x
	
	li $t0, B_INIT_X
	sw $t0, ball_x
	li $t0, B_INIT_Y
	sw $t0, ball_y
	
	li $t0, 1
	sw $t0, ball_vx
	sw $t0, ball_vy
	
	j main
	
perdeu_loop_NXT:
	jal frame_sync_delay
	j perdeu_loop

	
main_game_loop_NXT:
	jal frame_sync_delay
	j main_game_loop
    
play_sound:
    # Carregar parmetros
    li $a0, 62              # Pitch (D4)
    lw $a1, duration        # Durao
    lw $a2, instrument      # Instrumento
    lw $a3, volume          # Volume

    # Chamar funo MIDI out
    li $v0, 31              # Chamada para MIDI out
    syscall

    jr $ra


# -------------------------------------------------------------------
# draw_image
# a0: address of the image
# a1: start h
# a2: start w
# -------------------------------------------------------------------

draw_image:
	# t1, t2: dh, dw
	li $t1, 0
	# t3, t4: img_h, img_w
	lw $t3, 0($a0)
	lw $t4, 4($a0)
	# t5: reading address
	addi $t5, $a0, 8
draw_image_L1:
	# if dh >= img_h then break
	bge $t1, $t3, draw_image_L1_END
	# t0 = S_BS + ((a1 + t1) * S_W + a2) * 4 (the first writting address of this line)
	add $t0, $a1, $t1
	sll $t0, $t0, S_WB
	add $t0, $t0, $a2
	sll $t0, $t0, 2
	addi $t0, $t0, S_BS
	# Set t2 to 0
	li $t2, 0
draw_image_L2:
	# if dw >= img_w then break
	bge $t2, $t4, draw_image_L2_END
	# if dh + a1 < 0 or dh + a1 >= S_H then continue
	add $t6, $t1, $a1
	bltz $t6, draw_image_L2_NXT
	bge $t6, S_H, draw_image_L2_NXT
	# if dw + a2 < 0 or dw + a2 >= S_W then continue
	add $t6, $t2, $a2
	bltz $t6, draw_image_L2_NXT
	bge $t6, S_W, draw_image_L2_NXT
	# Copy the pixel
	lw $t6, 0($t5)
	sw $t6, 0($t0)
draw_image_L2_NXT:
	addi $t2, $t2, 1
	addi $t0, $t0, 4
	addi $t5, $t5, 4
	j draw_image_L2
draw_image_L2_END:
	addi $t1, $t1, 1
	j draw_image_L1
draw_image_L1_END:
	jr $ra

# -------------------------------------------------------------------
# erase
# a0: start h
# a1: start w
# a2: height
# a3: weidth
# -------------------------------------------------------------------

erase:
	# t1, t2: h, w
	move $t1, $a0
	# change a2, a3 to end h, end w
	add $a2, $a2, $a0
	add $a3, $a3, $a1
erase_L1:
	# if h >= a2 then break
	bge $t1, $a2, erase_L1_END
	# t0 = S_BS + (t1 * S_W + a1) * 4 (the first writting address of this line)
	move $t0, $t1
	sll $t0, $t0, S_WB
	add $t0, $t0, $a1
	sll $t0, $t0, 2
	addi $t0, $t0, S_BS
	# Set t2 to a1
	move $t2, $a1
erase_L2:
	# if w >= a3 then break
	bge $t2, $a3, erase_L2_END
	# if h < 0 or h >= S_H then continue
	bltz $t1, erase_L2_NXT
	bge $t1, S_H, erase_L2_NXT
	# if w < 0 or w >= S_W then continue
	bltz $t2, erase_L2_NXT
	bge $t2, S_W, erase_L2_NXT
	li $t3, C_BG
	sw $t3, 0($t0)
erase_L2_NXT:
	addi $t2, $t2, 1
	addi $t0, $t0, 4
	j erase_L2
erase_L2_END:
	addi $t1, $t1, 1
	j erase_L1
erase_L1_END:
	jr $ra

# -------------------------------------------------------------------
# add64
# A 64bit add algorithm
# v1:v0 = a1:a0 + a3:a2 (hi: v1, a1, a3; lo: v0, a0, a2)
# -------------------------------------------------------------------
add64:
	addu $v0, $a0, $a2
	nor $a2, $a2, $zero
	sltu $a2, $a2, $a0
	addu $v1, $a2, $a1
	addu $v1, $v1, $a3
	jr $ra

# -------------------------------------------------------------------
# frame_sync_init
# Init the system time for consistent frame rate
# -------------------------------------------------------------------
frame_sync_init:
	li $v0, 30
	syscall
	sw $a0, time_lo
	sw $a1, time_hi
	jr $ra

# -------------------------------------------------------------------
# frame_sync_delay
# -------------------------------------------------------------------
frame_sync_delay:
	# Save ra
	addi $sp, $sp, 4
	sw $ra, 0($sp)
	# Get current game time
	li $v0, 30
	syscall
	move $t0, $a0
	move $t1, $a1
	# Load last game time
	lw $t2, time_lo
	lw $t3, time_hi
	# Calculate the difference
	nor $a0, $t2, $zero
	nor $a1, $t3, $zero
	li $a2, 1
	li $a3, 0
	jal add64
	move $a0, $t0
	move $a1, $t1
	move $a2, $v0
	move $a3, $v1
	jal add64
	move $t0, $v0
	# Sleep(Delay - difference)
	li $v0, 32
	li $a0, DLY
	sub $a0, $a0, $t0
	# if a0 < 0 then set a0 = 0
	bgez $a0, frame_sync_delay_call
	li $a0, 0
	
frame_sync_delay_call:
	syscall
	# Load ra
	lw $ra, 0($sp)
	addi $sp, $sp, -4
	jr $ra

check_block_collision:
    # Salvar valores de registradores salvos
    addi $sp, $sp, -16  # Reservar espao na pilha
    sw $s0, 0($sp)
    sw $s1, 4($sp)
    sw $s2, 8($sp)
    sw $ra, 12($sp)
    
    la $s0, block_matrix   # Carregar a matriz de blocos
    li $s1, 0              # Contador de blocos
    li $s2, 28             # Total de blocos (7x4)
    li $s3, 0  		   # Flag para indicar se houve coliso

check_block_loop:
    beq $s1, $s2, end_check_block  # Se j verificamos todos os blocos, sair
    
    # Carregar informaes do bloco (x, y, w, h, ativo)
    lw $t0, 0($s0)  # x do bloco
    lw $t1, 4($s0)  # y do bloco
    lw $t2, 8($s0)  # largura do bloco
    lw $t3, 12($s0) # altura do bloco
    lw $t4, 16($s0) # status do bloco (ativo/inativo)
    
    beqz $t4, skip_block # Se o bloco estiver inativo, pular
    
    # Se j houve uma coliso, pular o restante
    bnez $s3, skip_block  # Se j houve uma coliso, pular

    # Verificar coliso da bola com o bloco
    lw $t5, ball_x   # Posio x da bola
    lw $t6, ball_y   # Posio y da bola

    # Calcular o limite direito e inferior do bloco
    add $t7, $t0, $t2 # limite direito do bloco
    add $t8, $t1, $t3 # limite inferior do bloco

    # Verificar se a bola est dentro do bloco
    blt $t5, $t0, skip_block       # Se a bola estiver  esquerda do bloco, pular
    bge $t5, $t7, skip_block       # Se a bola estiver  direita do bloco, pular
    blt $t6, $t1, skip_block       # Se a bola estiver acima do bloco, pular
    bge $t6, $t8, skip_block       # Se a bola estiver abaixo do bloco, pular
    
    # Coliso detectada, inverter direo da bola
    lw $t7, ball_vy
    not $t7, $t7
    sw $t7, ball_vy

    lw $t7, main_cnt
    addi $t7, $t7, 5
    sw $t7, main_cnt
    
    # Desativar o bloco
    li $t4, 0
    sw $t4, 16($s0)
    li $s3, 1  # Indicar que houve uma coliso

    addiu $sp, $sp, -4
    sw $ra, ($sp)
        
    move $a0, $t1 # y
    subi $a0, $a0, BL_H
    move $a1, $t0 # x
    #subi $a1, $a1, BL_W
    move $a2, $t3 # h
    move $a3, $t2 # w
    jal erase
    
    lw $ra, ($sp)
    addiu $sp, $sp, 4
    
    j end_check_block

skip_block:
    addi $s1, $s1, 1      # Prximo bloco
    addi $s0, $s0, 20     # Prxima entrada no block_matrix
    j check_block_loop

end_check_block:
    # Restaurar os registradores salvos
    lw $s0, 0($sp)
    lw $s1, 4($sp)
    lw $s2, 8($sp)
    lw $ra, 12($sp)
    addi $sp, $sp, 16  # Liberar espao na pilha
    jr $ra             # Retornar
    	
main_EXIT:
	# End program
	li $v0, 10
	syscall
